 Cukup ketik kode C atau C++ yang ingin Anda jalankan di prompt dan Chat-GPT akan memberi Anda output dari program itu sebagai tanggapan.

 Ini berguna jika Anda tidak menginstal kompiler di PC Anda dan ingin menguji beberapa kode sekarang Anda dapat melakukannya dengan perintah sederhana.

